  render() {
    return (
      <section className="jobInstance">
        <JobInstance title="Software Engineer, Front-end" />{" "}
        <JobInstance title="Software Engineer, Back-end" />
        <JobInstance title="AI Researcher" />
        <JobInstance title="" />{" "}
      </section>
    );
  }
}

const JobInstance = (props) => {
  return (
    <article className="job_box">
